(112, 'how_it_work_content_2', '<div class=\"row gx-0 gy-4\" dir=\"rtl\">\n    <div class=\"col-lg-4 d-flex\">\n        <div class=\"work-item text-center flex-fill\">\n            <div class=\"mb-3\">\n                <img src=\"/front/img/icons/work-01.svg\" alt=\"img\">\n            </div>\n            <h6 class=\"text-white mb-2\">١. نشر الخدمة</h6>\n            <p>بعد نشر الوظيفة، يقوم نظام المطابقة لدينا بتحديد مقدمي الخدمة المعنيين وتنبيههم، مما يتيح لهم إبداء اهتمامهم بعملك.</p>\n        </div>\n    </div>\n    <div class=\"col-lg-4 d-flex\">\n        <div class=\"work-item text-center flex-fill\">\n            <div class=\"mb-3\">\n                <img src=\"/front/img/icons/work-01.svg\" alt=\"img\">\n            </div>\n            <h6 class=\"text-white mb-2\">٢. الحجز وإنجاز العمل</h6>\n            <p>بعد نشر الوظيفة، يقوم نظام المطابقة لدينا بتحديد مقدمي الخدمة المعنيين وتنبيههم، مما يتيح لهم إبداء اهتمامهم بعملك.</p>\n        </div>\n    </div>\n    <div class=\"col-lg-4 d-flex\">\n        <div class=\"work-item work-03 text-center flex-fill\">\n            <div class=\"mb-3\">\n                <img src=\"/front/img/icons/work-03.svg\" alt=\"img\">\n            </div>\n            <h6 class=\"text-white mb-2\">٣. الحصول على مراجعات والحصول على عملاء</h6>\n            <p>بعد نشر الوظيفة، يقوم نظام المطابقة لدينا بتحديد مقدمي الخدمة المعنيين وتنبيههم، مما يتيح لهم إبداء اهتمامهم بعملك.</p>\n        </div>\n    </div>\n</div>', 2, 14, '2025-01-02 07:16:09', '2025-01-02 07:16:09'),
(113, 'how_it_work_content_1', '<div class=\"row gx-0 gy-4\">\r\n					<div class=\"col-lg-4 d-flex\">\r\n						<div class=\"work-item text-center flex-fill\">\r\n							<div class=\"mb-3\">\r\n								<img src=\"/front/img/icons/work-01.svg\" alt=\"img\">\r\n							</div>\r\n							<h6 class=\"text-white mb-2\">1. Post a Service</h6>\r\n							<p>After you post a job, our matching system identifies and alerts relevant Provider, who\r\n								can then express interest in your job.</p>\r\n						</div>\r\n					</div>\r\n					<div class=\"col-lg-4 d-flex\">\r\n						<div class=\"work-item text-center flex-fill\">\r\n							<div class=\"mb-3\">\r\n								<img src=\"/front/img/icons/work-01.svg\" alt=\"img\">\r\n							</div>\r\n							<h6 class=\"text-white mb-2\">2. Getting Booked &amp; Job done</h6>\r\n							<p>After you post a job, our matching system identifies and alerts relevant Provider, who\r\n								can then express interest in your job.</p>\r\n						</div>\r\n					</div>\r\n					<div class=\"col-lg-4 d-flex\">\r\n						<div class=\"work-item work-03 text-center flex-fill\">\r\n							<div class=\"mb-3\">\r\n								<img src=\"/front/img/icons/work-03.svg\" alt=\"img\">\r\n							</div>\r\n							<h6 class=\"text-white mb-2\">3. Get Reviewd &amp; Get Leads</h6>\r\n							<p>After you post a job, our matching system identifies and alerts relevant Provider, who\r\n								can then express interest in your job.</p>\r\n						</div>\r\n					</div>\r\n				</div>', 1, 14, '2025-01-02 07:39:22', '2025-05-16 00:06:38'),
