(2, 'Booking Invoice', 'Booking', '<meta charset=\"UTF-8\">\r\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n<title>Invoice Template</title>\r\n\r\n<div style=\"max-width: 800px; margin: auto; border: 1px solid #ccc; padding: 20px;\">\r\n     <table style=\"width: 100%; border-collapse: collapse; font-size: 1rem; margin-bottom: 40px; border: 0;\">\r\n        <tbody><tr style=\"border: 0;\">\r\n            <td style=\"border: 0;   vertical-align: top; padding-bottom: 20px;\">\r\n              <div style=\"margin-bottom: 20px; vertical-align: top !important;\">\r\n                <img src=\"{{logo}}\" style=\"height: 80px;\" alt=\"logo\">\r\n              </div>\r\n            <h1 style=\"margin: 0; background-color: #FF008A; padding: 10px; font-size: 24px; \r\n    color: #fff;\">{{company_name}}</h1>\r\n<p style=\"color: #6c757d; font-size: 1rem;\">Thank you for your business!</p>\r\n            \r\n        </td>\r\n        <td style=\"border: 0; vertical-align: top; padding-bottom: 20px; padding-top: 80px;\">\r\n            <p style=\"margin: 0; text-align: right;\">Date: {{date}}<br>\r\n                Invoice Number: {{id}}<br>Invoice&nbsp;For: Booking</p>\r\n         </td>\r\n       </tr>\r\n    </tbody>\r\n   </table>\r\n\r\n    <table style=\"width: 100%; border-collapse: collapse; font-size: 1rem; margin-bottom: 40px; border: 0;\">\r\n        <tbody><tr style=\"border: 0;\">\r\n            <td style=\"border: 0;   vertical-align: top; padding-bottom: 20px;\">\r\n                <h4 style=\"margin-bottom: 10px;  background-color: #FF008A; color: #fff; padding: 10px; font-size: 1.25rem;\">From:</h4>\r\n                <p style=\"margin: 0;  padding: 10px; font-size: 1rem;\">\r\n                    <strong>{{company_name}}</strong><br>\r\n                    {{company_address}}<br>\r\n                    Email: {{company_email}}<br>\r\n                    Phone: {{company_phone}}\r\n                </p>\r\n            </td>\r\n            <td style=\"border: 0; vertical-align: top; padding-bottom: 20px;\">\r\n                <h4 style=\"margin-bottom: 10px;  background-color: #FF008A; color: #fff; padding: 10px; font-size: 1.25rem;\">To:</h4>\r\n                <p style=\"margin: 0; font-size: 1rem;\">\r\n                    <strong>{{user_name}}</strong><br>\r\n                    {{user_address}}<br>\r\n                    Email: {{user_email}}<br>\r\n                    Phone: {{user_phone}}\r\n                </p>\r\n            </td>\r\n        </tr>\r\n    </tbody></table>\r\n\r\n\r\n    <table style=\"width: 100%; border-collapse: collapse; margin-bottom: 20px;\">\r\n        <thead>\r\n            <tr style=\"background-color: #FF008A; color: #fff;\">\r\n                <th style=\"padding: 10px; text-align: left; border: 1px solid #ccc;\">Description</th>\r\n                <th style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">Unit Cost</th>\r\n                <th style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">Rate/Hr $</th>\r\n                <th style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">Total</th>\r\n            </tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr>\r\n                <td style=\"padding: 10px; border: 1px solid #ccc;\">{{category}}</td>\r\n                <td style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">${{service_amount}}</td>\r\n                <td style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">{{ratehour}}</td>\r\n                <td style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">${{service_amount}}</td>\r\n            </tr>\r\n           \r\n        </tbody>\r\n    </table>\r\n\r\n    <div style=\"margin-bottom: 20px; \">\r\n        <h4 style=\"margin: 0; background-color: #FF008A; color: #fff; padding: 10px;\">Notes</h4>\r\n        <p style=\"margin: 5px 0;\">It was a pleasure working with you.</p>\r\n    </div>\r\n\r\n   <table style=\"width: 50%; text-align: right; border-collapse: collapse; margin-left: auto; margin-right: 0;\">\r\n        <tbody>\r\n            <tr>\r\n                <td style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">Subtotal</td>\r\n                <td style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">${{service_amount}}</td>\r\n            </tr>          \r\n            <tr>\r\n                <td style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">Tax rate</td>\r\n                <td style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">${{amount_tax}}</td>\r\n            </tr>\r\n            <tr>\r\n                <td style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">Total tax</td>\r\n                <td style=\"padding: 10px; text-align: right; border: 1px solid #ccc;\">${{amount_tax}}</td>\r\n            </tr>\r\n            <tr>\r\n                <td style=\"padding: 10px; text-align: right; font-weight: bold; border: 1px solid #ccc;\">Total estimate</td>\r\n                <td style=\"padding: 10px; text-align: right; border: 1px solid rgb(204, 204, 204);\"><span style=\"font-weight: bold;\">${{quote}}</span></td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n\r\n    <footer style=\"text-align: center; margin-top: 20px; color: #555;\">\r\n        <p><br></p>\r\n    </footer>\r\n</div>', 0, '2024-10-30 03:48:37', '2025-01-25 03:03:17', NULL),
(3, 'Payout Invoice', 'Payout', '<div style=\"width: 100%; margin: 20px auto; font-family: Arial, sans-serif; line-height: 1.5;\">\r\n\r\n    <div style=\"text-align: center; margin-bottom: 40px;\">\r\n        <div style=\"margin-bottom: 20px; vertical-align: top !important;\">\r\n            <img src=\"{{logo}}\" style=\"height: 80px;\" alt=\"logo\">\r\n        </div>\r\n        <h1 style=\"font-size: 2.5rem; margin: 0;\">Invoice</h1>\r\n        <p style=\"color: #6c757d; font-size: 1rem;\">Thank you for your business!</p>\r\n    </div>\r\n\r\n    <!-- From and To content in a table with zero borders -->\r\n    <table style=\"width: 100%; border-collapse: collapse; font-size: 1rem; margin-bottom: 40px; border: 0;\">\r\n        <tbody><tr style=\"border: 0;\">\r\n            <td style=\"border: 0; vertical-align: top; padding-bottom: 20px;\">\r\n                <h4 style=\"margin-bottom: 10px; font-size: 1.25rem;\">From:</h4>\r\n                <p style=\"margin: 0; font-size: 1rem;\">\r\n                    <strong>{{company_name}}</strong><br>\r\n                    {{company_address}}<br>\r\n                    Email: {{company_email}}<br>\r\n                    Phone: {{company_phone}}\r\n                </p>\r\n            </td>\r\n            <td style=\"border: 0; vertical-align: top; padding-bottom: 20px;\">\r\n                <h4 style=\"margin-bottom: 10px; font-size: 1.25rem;\">To:</h4>\r\n                <p style=\"margin: 0; font-size: 1rem;\">\r\n                    <strong>{{user_name}}</strong><br>\r\n                    {{user_address}}<br>\r\n                    Email: {{user_email}}<br>\r\n                    Phone: {{user_phone}}\r\n                </p>\r\n            </td>\r\n        </tr>\r\n    </tbody></table>\r\n\r\n    <!-- Invoice Table -->\r\n    <table style=\"width: 100%; border-collapse: collapse; font-size: 1rem; margin-bottom: 20px;\">\r\n        <thead style=\"background-color: #f8f9fa; text-align: left;\">\r\n            <tr>\r\n                <th style=\"border: 1px solid #dee2e6; padding: 8px;\">#</th>\r\n                <th style=\"border: 1px solid #dee2e6; padding: 8px;\">Item</th>\r\n                <th style=\"border: 1px solid #dee2e6; padding: 8px;\">Description</th>\r\n                <th style=\"border: 1px solid #dee2e6; padding: 8px; text-align: right;\">Amount</th>\r\n            </tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr>\r\n                <td style=\"border: 1px solid #dee2e6; padding: 8px;\">1</td>\r\n                <td style=\"border: 1px solid #dee2e6; padding: 8px;\">Service/Quote</td>\r\n                <td style=\"border: 1px solid #dee2e6; padding: 8px;\">{{description}}</td>\r\n                <td style=\"border: 1px solid #dee2e6; padding: 8px; text-align: right;\">${{quote}}</td>\r\n            </tr>\r\n        </tbody>\r\n        <tfoot>\r\n            <tr>\r\n                <th colspan=\"3\" style=\"border: 1px solid #dee2e6; padding: 8px; text-align: right;\">Total</th>\r\n                <th style=\"border: 1px solid #dee2e6; padding: 8px; text-align: right;\">${{quote}}</th>\r\n            </tr>\r\n        </tfoot>\r\n    </table>\r\n</div>', 0, '2024-10-30 04:03:03', '2025-01-22 05:22:12', NULL),
