ct keyword', 'Welcome to Truelysell', '[Your Company Name] provides top-notch [products/services] in [industry/niche]. Discover our commitment to quality, innovation, and customer satisfaction. Join us in creating a better [benefit, e.g., connected world, efficient solutions.', 1, 'home_one', '2024-11-11 07:42:48', '2025-06-20 04:03:45', NULL),
(27, 1, 0, 'About Us', 'about-us', '[]', '<h2><span style=\"color: rgb(17, 24, 39); font-family: Archivo, sans-serif; font-size: 16px; text-transform: uppercase; text-align: var(--bs-body-text-align);\">ABOUT OUR COMPANY<br></span><span style=\"color: inherit; font-size: 14px; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">Our platform is designed to\r\n	simplify the process of discovering, evaluating, and hiring trusted professionals\r\n	across a wide range of services, from home improvement and IT support to personal\r\n	care and more.</span></h2>\r\n<p>At Truelysell, our mission is to bridge the gap between service providers and\r\n	customers by offering a seamless and efficient marketplace experience. We aim to\r\n	empower both parties by providing a reliable platform where quality, transparency,\r\n	and customer satisfaction are our top priorities.</p>\r\n<div class=\"row\">\r\n	<div class=\"col-md-6\">\r\n		<ul>\r\n			<li class=\"text-truncate\"><i class=\"ti ti-circle-check-filled text-dark me-1\"></i>We prioritize quality and reliability</li>\r\n			<li class=\"text-truncate\"><i class=\"ti ti-circle-check-filled text-dark me-1\"></i>WeSaving your time and effort.</li>\r\n		</ul>\r\n	</div>\r\n	<div class=\"col-md-6\">\r\n		<ul>\r\n			<li class=\"text-truncate\"><i class=\"ti ti-circle-check-filled text-dark me-1\"></i>Clear, detailed service listings &amp; reviews</li>\r\n			<li class=\"text-truncate\"><i class=\"ti ti-circle-check-filled text-dark me-1\"></i> Smoot</li></ul><ul>\r\n		</ul>\r\n	</div>\r\n</div>', NULL, NULL, NULL, 'tag,sad,addh,aoidssa', 'title', 'Description', 1, 'about_one', '2024-11-11 07:52:10', '2025-06-18 23:00:38', NULL),
(28, 1, 0, 'Terms and Conditions', 'terms-conditions', '[]', NULL, '<div class=\"mb-3\">\r\n<h3>Terms &amp; condition\r\n</h3>\r\n</div>\r\n<div class=\"justify-content-between mb-3 text-justify\">\r\n<p> Welcome to <b>Truellysell.</b> These Terms and Conditions outline the rules and regulations for using our platform, which connects buyers and sellers for various services. By accessing or using our platform, you agree to comply with these Terms and Conditions. Please read them carefully. </p>\r\n</div>\r\n\r\n<div class=\"mb-3\">\r\n    <h5>1. Definitions</h5></div><div class=\"mb-3\"><ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i><b>User:</b> Any individual or entity accessing or using the platform, including buyers and sellers. </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i><b>Services:</b> Services listed, bought, or sold on the platform. </li>\r\n    </ul>\r\n</div>\r\n\r\n<div class=\"mb-3\">\r\n    <h5>2. User Eligibility</h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <h6>To use our platform: </h6>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>You agree to provide accurate and complete information during registration. </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>You must comply with all applicable laws and regulations.</li>\r\n    </ul>\r\n</div>\r\n\r\n<div class=\"mb-3\">\r\n    <h5>3. Account Responsibilities</h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Users are responsible for maintaining the confidentiality of their login credentials. </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Any activities conducted under your account are your responsibility. </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Notify us immediately if you suspect unauthorized access or activity. </li>\r\n    </ul>\r\n</div>\r\n\r\n\r\n<div class=\"mb-3\">\r\n    <h5>4. Services and Listings</h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <h6>a. Sellers’ Responsibilities:</h6>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Ensure the accuracy and completeness of service descriptions and pricing. </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Comply with all legal and regulatory requirements related to your services.</li>\r\n<li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Avoid posting prohibited content, such as illegal, offensive, or fraudulent services.</li>\r\n    </ul>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <h6>b. Buyers’ Responsibilities:</h6>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Conduct due diligence before purchasing services. </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Ensure timely payment for agreed-upon services.\r\n</li>\r\n<li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Refrain from requesting services that violate laws or platform policies. </li>\r\n    </ul>\r\n</div>\r\n\r\n\r\n<div class=\"mb-3\">\r\n    <h5>5. Transactions</h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i><b>Payments:</b> All payments must be processed through the methods provided on the platform. </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i><b>Fees:</b> Truellysell may charge service or transaction fees. These will be disclosed upfront. </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i><b>Disputes:</b> Buyers and sellers are encouraged to resolve disputes amicably. If necessary, disputes can be escalated to our support team for resolution. </li>\r\n    </ul>\r\n</div>\r\n\r\n\r\n<div class=\"mb-3\">\r\n    <h5>6. Prohibited Activities</h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <h6>Users must not: </h6>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Post, promote, or engage in fraudulent, illegal, or harmful activities. </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Harass, abuse, or harm other users. </li>\r\n<li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Attempt to gain unauthorized access to the platform or its data. </li>\r\n    </ul>\r\n</div>\r\n\r\n<div class=\"mb-3\">\r\n    <h5>7. Termination</h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <p>We reserve the right to suspend or terminate accounts for violations of these Terms and Conditions or other policies.\r\n</p>\r\n</div>', NULL, NULL, 'Terms and Conditions', 'Terms and Conditions', 'Terms and Conditions', 1, 'terms_one', '2024-11-11 22:12:33', '2025-04-09 04:06:20', NULL),
(29, 1, 0, 'Privacy Policy', 'privacy-policy', '[]', NULL, NULL, '<div class=\"mb-3\">\r\n<h3>Privacy Policy\r\n</h3>\r\n</div>\r\n<div class=\"justify-content-between mb-3 text-justify\">\r\n<p> At Truellysell, your privacy is of utmost importance to us. This Privacy Policy outlines how we collect, use, and protect your personal information when you use our platform. By accessing or using our services, you agree to the terms of this Privacy Policy. </p>\r\n</div>\r\n\r\n<div class=\"mb-3\">\r\n    <h5>1. Information We Collect\r\n</h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <p>We collect information to provide and improve our services. This includes:\r\n</p>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <h6>a. Information You Provide Directly:</h6>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Name, email address, phone number, and other contact details.</li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Payment information (e.g., billing address and payment method). </li>\r\n<li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Service listings, descriptions, and other content you upload. </li>\r\n    </ul>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <h6>b. Information We Collect Automatically:</h6>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Device information (e.g., IP address, browser type, and operating system). </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Usage data (e.g., pages visited, clicks, and time spent on the platform). </li>\r\n<li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Cookies and similar technologies to enhance your experience.\r\n</li>\r\n    </ul>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <h6>c. Information from Third Parties:</h6>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Social media platforms (if you connect your account to our platform). </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Publicly available information and data from partners. </li>\r\n    </ul>\r\n</div>\r\n\r\n<div class=\"mb-3\">\r\n    <h5>2. How We Use Your Information</h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Provide and maintain our platform and services. </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Process transactions and send payment confirmations. </li><li>\r\n</li>\r\n<li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Personalize user experiences and improve platform functionality.\r\n </li>\r\n<li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Communicate with you about updates, offers, and promotions. </li>\r\n<li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Prevent fraudulent activities, unauthorized access, and abuse of our platform.</li>\r\n    </ul>\r\n</div>\r\n\r\n\r\n<div class=\"mb-3\">\r\n    <h5>3. Sharing Your Information\r\n</h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i><b>With Service Providers:</b> To help us operate the platform (e.g., payment processors, hosting providers).\r\n </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i><b>With Other Users:</b> Limited information may be shared to facilitate transactions (e.g., buyer and seller communication).\r\n</li><li>\r\n</li><li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i><b>With Legal Authorities:</b> When required to comply with legal obligations or to protect our rights.\r\n </li>\r\n<li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i><b>In Business Transfers:</b> If we undergo a merger, acquisition, or sale of assets, your information may be transferred as part of the transaction.\r\n</li>\r\n    </ul>\r\n</div>\r\n\r\n<div class=\"mb-3\">\r\n    <h5>4. Cookies and Tracking Technologies\r\n</h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <h6>We use cookies and similar technologies to: </h6>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Remember your preferences and settings\r\n </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i><b>With Other Users:</b> Limited information may be shared to facilitate transactions (e.g., buyer and seller communication).\r\n</li>\r\n<li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Analyze platform performance and user interactions.\r\n</li>\r\n    </ul>\r\n</div>\r\n\r\n\r\n<div class=\"mb-3\">\r\n    <h5>5. Data Security\r\n</h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <h6>We implement robust security measures to protect your information from unauthorized access, alteration, disclosure, or destruction. These include:</h6>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Encryption of sensitive data. </li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Regular security assessments and updates. </li><li>\r\n</li><li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Restricted access to personal information. </li>\r\n    </ul>\r\n</div>\r\n\r\n<div class=\"mb-3\">\r\n    <h5>6. Your Rights </h5>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <h6>You have the right to:</h6>\r\n</div>\r\n<div class=\"mb-3\">\r\n    <ul>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Access, update, or delete your personal information.\r\n</li>\r\n        <li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Opt out of receiving marketing communications. </li><li>\r\n</li><li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Restrict or object to certain data processing activities. </li>\r\n<li class=\"mb-2\"><i class=\"ti ti-circle-check-filled text-primary me-1\"></i>Request a copy of the personal information we hold about you. </li>\r\n    </ul>\r\n</div>', NULL, 'Privacy Policy', 'Privacy Policy', 'Privacy Policy', 1, 'policy_one', '2024-11-11 22:14:40', '2024-12-19 10:59:46', NULL),
