(1, 'OTP Verification', 1, 2, NULL, 'Reg - OTP Verification for login', '<p>Hi {{user_name}},&nbsp;<br></p><p>&nbsp; &nbsp; &nbsp; &nbsp; Your OTP Verification for login is&nbsp;<span style=\"color: inherit; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">{{otp}}.</span></p>', 1, 1, '2024-11-20 12:43:23', 1, '2024-11-20 12:43:23', NULL),
(2, 'Reg - OTP Verification for login', 2, 2, NULL, 'Reg - OTP Verification for login', 'Hi {{user_name}}, your OTP verification code for login is {{otp}}.', 1, 1, '2024-11-21 10:49:33', 1, '2024-11-21 10:49:33', NULL),
(3, 'New leads', 1, 4, NULL, 'New Lead Request Received – Truelysell Laravel', '<p>Dear {{provider_name}},</p><p>We’re excited to inform you that a new lead request has been received for your services! Below are the details for your review:</p><p><span style=\"text-align: var(--bs-body-text-align);\">Lead Details:</span></p><p>Name: {{user_name}}</p><p>Service Requested: {{category_name}}</p><p><br></p><p>Thank you for your continued dedication to providing excellent service!</p><p>Best regards,</p><p>Admin</p><p style=\"margin-bottom: 20px;\">{{company_name}}</p>', 1, 1, '2024-11-25 07:39:09', 1, '2024-12-16 07:43:36', NULL),
(4, 'Accept Leads Provider', 1, 5, NULL, 'Exciting News: Your Service Request Has Been Accepted!', '<p>Dear {{user_name}},</p><p><br></p><p>We are thrilled to inform you that our service provider has accepted your service request! We appreciate your interest in {{company_name}}, and we’re excited to assist you.</p><p><br></p><p>Here’s What Happens Next:</p><p>The service provider will share the quote and finalize the details.</p><p>Please feel free to share any specific needs or preferences during this conversation.</p><p>Your Request Details:</p><p>Service Requested: {{category_name}}</p><p>Reference Number: {{leads_id}}</p><p><br></p><p>Thank you for choosing {{company_name}}! We look forward to delivering an exceptional experience.</p><p><br></p><p>Best regards,</p><p>Admin</p><p>{{company_name}}</p>', 1, 1, '2024-11-25 08:40:54', 1, '2024-12-19 05:35:03', NULL),
(5, 'Accept Leads User', 1, 6, NULL, 'Quote Accepted', '<p>Dear {{provider_name}},</p><p>We are pleased to inform you that the quote you provided for&nbsp;{{category_name}}&nbsp;has been accepted by{{user_name}}. Below are the details of the accepted quote:</p><p>Quote Details</p><p>Service: {{category_name}}</p><p>User Name: {{user_name}}</p><p>Quote Amount: {{quote_amount}}</p><p>Date Accepted: {{accepted_date}}</p><p>Reference Number: {{leads_id}}</p><p><br></p><p><br></p><p>Thank you for partnering with {{company_name}}!</p><p>Best regards,</p><p>Admin</p><p>{{company_name}}</p>', 1, 1, '2024-11-25 10:03:09', 1, '2024-12-19 05:23:01', NULL),
(6, 'Reject Leads Provider', 1, 7, NULL, 'Update on Your Service Request – Truelysell Laravel', '<p>Dear {{user_name}},</p><p>Thank you for reaching out to {{company_name}}&nbsp;and showing interest in our services. We appreciate the opportunity to connect with you.</p><p><br></p><p>Unfortunately, after reviewing your request, we regret to inform you that we are unable to proceed with your lead at this time due to specific requirements outside our scope.</p><p><br></p><p>Thank you for your understanding, and we hope to have the opportunity to serve you in the future.</p><p>Best regards,</p><p>Admin</p><p>{{company_name}}</p>', 1, 1, '2024-11-25 11:11:24', 1, '2024-12-19 05:24:49', NULL),
(7, 'Reject Leads User', 1, 8, NULL, 'Quote Rejected – Update on Lead Request', '<div>Dear {{provider_name}},,</div><div>We wanted to inform you that the quote you provided for the service request from {{user_name}} has been declined. Below are the details of the request for your reference:</div><div>Lead Details:</div><div>Name: {{user_name}}</div><div>Service Requested: {{category_name}}</div><div>Quote Amount: {{quote_amount}}</div><div><br></div><div><br></div><div>We understand this may be disappointing, but please rest assured that we value your partnership and the effort you put into responding to leads.</div><div><br></div><div>Thank you for your understanding and dedication to providing excellent service.</div><div>Best regards,</div><div>Admin</div><div>{{company_name}}</div>', 1, 1, '2024-11-25 11:13:07', 1, '2024-12-19 05:23:48', NULL),
(8, 'Newsletter', 1, 9, NULL, 'Reg - Newsletter', 'You have successfully subscribed our newsletter.', 1, 1, '2024-12-03 04:22:28', 1, '2024-12-03 04:24:06', NULL),
(11, 'Provider Booking Cancel email to User', 1, 16, NULL, 'Your Booking {{service_name}} Has Been Cancelled!', '<p><strong>Dear&nbsp;</strong>{{customer_name}}<strong>,</strong></p><p>We regret to inform you that your service booking has been canceled. Below are the details of your booking:</p><ul><li><strong>&nbsp; &nbsp; &nbsp; Booking ID</strong>: {{booking_id}}</li><li><strong>&nbsp; &nbsp; &nbsp; Service Name</strong>:&nbsp;<span style=\"font-size: 15px;\">{{service_name}}</span></li><li><strong>&nbsp; &nbsp; &nbsp; Scheduled Date &amp; Time</strong>: {{appointment_date}} and&nbsp;&nbsp;{{appointment_time}}</li><li><strong>&nbsp; &nbsp; &nbsp; Service Provider</strong>: {{provider_name}}</li></ul><p>If this cancellation was unintentional, or if you’d like to rebook, please feel free to contact us or book again directly on our website.</p><p>We apologize for any inconvenience this may have caused and are here to assist you with any questions or concerns.</p><p><strong>Contact Support</strong>: {{contact}}<br><strong>Website</strong>: {{website_link}}</p><p>Thank you for choosing {{provider_name}}. We hope to serve you again soon!</p><p>Best regards,<br><strong>{{provider_name}} Team</strong></p>', 1, 1, '2024-12-10 08:33:37', 1, '2024-12-10 08:33:37', NULL),
(12, 'Refund Initiation', 1, 12, NULL, 'Refund Initiation for Your Payment', '<p><strong>Dear {{customer_name}},</strong></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;We hope this message finds you well. We would like to inform you that your refund process has been initiated for your recent transaction with us. Below are the details of your refund request:</p><ul><li><strong>Refund ID</strong>: {{refund_id}}</li><li><strong>Payment Amount</strong>: {{refund_amount}}</li><li><strong>Transaction Date</strong>: {{transaction_date}}</li><li><strong>Service/Product</strong>: {{product_name}}</li><li><br></li></ul><p>Our team is processing your request, and the refund will be credited back to your original payment method. Please allow some business days for the refund to reflect in your account, depending on your bank or payment provider.</p><p>If you have any questions about this process or need further assistance, please feel free to reach out to us.</p><p><strong>Contact Support</strong>: {{contact}}<br><strong>Website</strong>: {{website_link}}</p><p>We apologize for any inconvenience caused and appreciate your understanding. Thank you for choosing {{company_name}}.</p><p>Best regards,<br><strong>{{company_name}} Team</strong></p><hr>', 1, 1, '2024-12-10 09:09:49', 1, '2024-12-10 09:09:49', NULL),
(13, 'Refund Confirmation', 1, 13, NULL, 'Refund Processed for Your Payment', '<p><strong>Dear {{customer_name}},</strong></p><p>We’re writing to inform you that a refund for your recent payment has been processed successfully. Below are the details of the refund:</p><ul><li><strong>Refund ID</strong>: {{refund_id}}</li><li><strong>Payment Amount</strong>: {{refund_amount}}</li><li><strong>Transaction Date</strong>: {{transaction_date}}</li><li><strong>Refund Date</strong>: {{refund_date}}</li><li><strong>Payment Method</strong>: {{payment_method}}</li><li><strong>Service/Product</strong>: {{product_name}}</li></ul><p>The refund will be credited back to your original payment method. Please note that it may take some business days for the amount to reflect in your account, depending on your bank or payment provider.</p><p>If you have any questions regarding this refund or need further assistance, please don’t hesitate to contact us.</p><p><strong>Contact Support</strong>: {{contact}}<br><strong>Website</strong>: {{website_link}}</p><p>We appreciate your understanding and thank you for choosing {{provider_name}}.</p><p>Best regards,<br><strong>{{provider_name}}Team</strong></p><hr>', 1, 1, '2024-12-10 09:16:44', 1, '2024-12-10 09:16:44', NULL),
