(50, 'Welcome Email', 1, 1, NULL, 'Reg - Welcome Email', '<p data-start=\"234\" data-end=\"272\"><strong data-start=\"234\" data-end=\"272\">Dear {{first_name}} {{last_name}},</strong></p>\n<p data-start=\"274\" data-end=\"306\">Welcome to <strong data-start=\"285\" data-end=\"305\">{{company_name}}</strong>!</p>\n<p data-start=\"308\" data-end=\"473\">We’re thrilled to have you as a part of our community. Your account has been successfully created, and you can now access a wide range of trusted services with ease.</p>\n<h5 data-start=\"475\" data-end=\"499\"><strong data-start=\"479\" data-end=\"499\">Account Details:</strong></h5>\n<ul data-start=\"500\" data-end=\"593\">\n<li data-start=\"500\" data-end=\"525\">\n<p data-start=\"502\" data-end=\"525\"><strong data-start=\"502\" data-end=\"511\">Email</strong>: {{email_id}}</p>\n</li>\n<li data-start=\"526\" data-end=\"555\">\n<p data-start=\"528\" data-end=\"555\"><strong data-start=\"528\" data-end=\"537\">Phone</strong>: {{phone_number}}</p>\n</li>\n<li data-start=\"556\" data-end=\"593\">\n<p data-start=\"558\" data-end=\"593\"><strong data-start=\"558\" data-end=\"574\">Account Name</strong>: {{customer_name}}</p>\n</li>\n</ul>\n<p data-start=\"595\" data-end=\"771\">To get started, log in to your account at <a data-start=\"637\" data-end=\"673\" class=\"cursor-pointer\" rel=\"noopener\">{{company_name}}</a> and explore our services</p>\n<p data-start=\"773\" data-end=\"901\">If you need any assistance, our support team is here to help. Feel free to reply to this email or contact us at <strong data-start=\"885\" data-end=\"900\">{{contact}}</strong>.</p>\n<p data-start=\"903\" data-end=\"975\">Thank you for choosing <strong data-start=\"926\" data-end=\"946\">{{company_name}}</strong>. We’re excited to serve you!</p>\n<p data-start=\"977\" data-end=\"1022\"><strong data-start=\"977\" data-end=\"994\">Best regards,</strong><br data-start=\"994\" data-end=\"997\">\n<strong data-start=\"997\" data-end=\"1022\">{{company_name}} Team</strong></p>', 1, 4, '2025-07-11 15:15:49', 4, '2025-07-11 15:15:49', NULL),
(51, 'Provider Verification Email', 1, 31, NULL, 'Your Provider Account Has Been Verified', '<p>Hello {{first_name}} {{last_name}},</p>\r\n\r\n<p>We’re happy to inform you that your provider account on <b>{{company_name}}</b> has been successfully verified by the admin team.</p>\r\n\r\n<p>You can now log in to your account and start offering your services on the platform.</p>\r\n\r\n<p>If you have any questions or need assistance, feel free to contact our support team.</p>\r\n\r\n<p>Thank you for joining us,<br>\r\nThe {{company_name}} Team</p>\r\n\r\n<p style=\"font-size:12px; color:#999;\">\r\nOr visit us anytime at:&nbsp;{{website_link}}</p>', 1, 4, '2025-07-17 21:56:21', 4, '2025-07-17 21:56:21', NULL),
(52, 'New Provider Signup Notification to Admin', 1, 32, NULL, '{{first_name}} {{last_name}} has signed up as a provider', '<p>Hello Admin,</p>\r\n\r\n<p>A new provider has just signed up on <strong>{{company_name}}</strong>.</p>\r\n\r\n<p><strong>Provider Details:</strong></p>\r\n<ul>\r\n    <li><strong>Name:</strong> {{first_name}} {{last_name}}</li>\r\n    <li><strong>Email:</strong> {{email_id}}</li>\r\n    <li><strong>Phone:</strong>&nbsp;{{phone_number}}</li>\r\n    <li><strong>Signup Date:</strong> {{signup_date}}</li>\r\n</ul>\r\n\r\n<p>Please review their profile and take any necessary approval actions.</p>\r\n\r\n<p>Thank you,<br>\r\nThe {{company_name}} System</p>', 1, 4, '2025-07-17 21:58:39', 4, '2025-07-17 21:58:39', NULL),
(53, 'Provider Service Verification Email', 1, 33, NULL, 'Your {{service_name}} Has Been Successfully Verified', '<p data-start=\"256\" data-end=\"284\"><strong data-start=\"256\" data-end=\"284\">Hello {{provider_name}},</strong></p>\r\n<p data-start=\"286\" data-end=\"418\">We’re pleased to inform you that your service <strong data-start=\"332\" data-end=\"354\">“{{service_name}}”</strong> has been successfully verified and is now live on our platform.</p>\r\n<p data-start=\"420\" data-end=\"506\">You can now start receiving requests and managing your service through your dashboard.</p>\r\n<p data-start=\"508\" data-end=\"597\">If you have any questions or need assistance, feel free to reach out to our support team.</p>\r\n<p data-start=\"599\" data-end=\"643\">Thank you for being a part of our community!</p>\r\n<p data-start=\"645\" data-end=\"682\">Best regards,<br data-start=\"658\" data-end=\"661\"><b>{{company_name}}</b><strong data-start=\"661\" data-end=\"682\"> Team</strong></p>', 1, 4, '2025-07-17 22:00:23', 4, '2025-07-17 22:00:23', NULL),
(54, 'Booking Accept email to Provider', 1, 37, NULL, 'You Have Accepted a New Booking – ID: {{booking_id}}', '<div>Dear {{provider_name}},</div>\n\n<div><br></div>\n\n<div>Thank you for accepting a new service booking. Here are the details of the confirmed appointment:</div>\n\n<div><br></div>\n\n<div>&nbsp; &nbsp; <strong>Booking ID:</strong> {{booking_id}}</div>\n<div>&nbsp; &nbsp; <strong>Service Name:</strong> {{service_name}}</div>\n<div>&nbsp; &nbsp; <strong>Scheduled Date &amp; Time:</strong> {{appointment_date}} at {{appointment_time}}</div>\n<div>&nbsp; &nbsp; <strong>Customer Name:</strong> {{customer_name}}</div><div><span style=\"color: inherit; font-weight: 700;\">&nbsp; &nbsp; Staff Name:</span><span style=\"color: inherit;\">&nbsp;</span>{{staff_name}}</div>\n\n<div><br></div>\n\n<div>Please ensure timely communication and service delivery to provide the best experience for the customer.</div>\n\n<div><br></div>\n\n<div>Thank you for your service and commitment!</div>\n\n<div><br></div>\n\n<div>Best regards,</div>\n<div>{{company_name}} Team</div>', 1, 4, '2024-12-27 08:34:28', 4, '2025-08-12 22:29:00', NULL),
(55, 'Booking Accept email to User', 1, 14, NULL, '{{service_name}} with {{provider_name}} is Accepted – Booking ID: {{booking_id}}', '<div>Dear {{customer_name}},</div>\n\n<div><br></div>\n\n<div>We’re happy to inform you that your service booking has been <strong>accepted</strong> by the provider. Below are the details of your confirmed booking:</div>\n\n<div><br></div>\n\n<div>&nbsp; &nbsp; <strong>Booking ID:</strong> {{booking_id}}</div>\n<div>&nbsp; &nbsp; <strong>Service Name:</strong> {{service_name}}</div>\n<div>&nbsp; &nbsp; <strong>Scheduled Date &amp; Time:</strong> {{appointment_date}} at {{appointment_time}}</div>\n<div>&nbsp; &nbsp; <strong>Provider Name:</strong> {{provider_name}}</div><div style=\"\"><span style=\"font-weight: 700;\">&nbsp; &nbsp; Staff Name:</span>&nbsp;{{staff_name}}</div>\n\n<div><br></div>\n\n<div>Please make sure to be available at the scheduled time. If you need to make any changes to your booking, you can do so through your account dashboard.</div>\n\n<div><br></div>\n\n<div>If you have any questions or need assistance, feel free to contact us:</div>\n<div><strong>Support:</strong> {{contact}}</div>\n<div><strong>Website:</strong> <a href=\"{{website_link}}\">{{website_link}}</a></div>\n\n<div><br></div>\n\n<div>Thank you for choosing our service!</div>\n\n<div><br></div>\n\n<div>Best regards,</div>\n<div>{{provider_name}} Team</div>', 1, 4, '2024-12-27 08:34:28', 4, '2025-08-12 22:26:40', NULL),
