(67, 'Refund Initiation email to Admin', 1, 43, NULL, 'Refund Initiated for {{service_name}} – Customer: {{customer_name}}', '<p><strong>Dear {{admin_name}},</strong></p>\r\n\r\n<p>We would like to notify you that a refund request has been initiated for the following transaction:</p>\r\n\r\n<ul>\r\n    <li><strong>Refund ID</strong>: {{refund_id}}</li>\r\n    <li><strong>Customer Name</strong>: {{customer_name}}</li>\r\n    <li><strong>Payment Amount</strong>: {{refund_amount}}</li>\r\n    <li><strong>Transaction Date</strong>: {{transaction_date}}</li>\r\n    <li><strong>Service/Product</strong>: {{service_name}}</li>\r\n    <li><strong>Provider</strong>: {{provider_name}}</li>\r\n</ul>\r\n\r\n<p>Please review and proceed with the necessary actions to ensure timely processing of this refund.</p>\r\n\r\n<p>If additional details or actions are needed, kindly coordinate with the support or finance team.</p>\r\n\r\n<p>Thank you.</p>\r\n\r\n<p>Best regards,<br>\r\n<strong>{{company_name}} System</strong></p>\r\n<hr>\r\n', 1, 13, '2024-12-10 09:09:49', 13, '2025-07-21 11:23:11', NULL),
