(72, 'Booking Success Email to User', 1, 49, NULL, 'Your {{service_name}} Booking is Confirmed!', '<p><b>Dear&nbsp;</b><span style=\"color: inherit; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">{{user_name}}</span><b style=\"text-align: var(--bs-body-text-align);\">,</b></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Thank you for choosing&nbsp;<span style=\"color: inherit; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">{{company_name}}</span><span style=\"text-align: var(--bs-body-text-align);\">! We’re delighted to confirm your booking for&nbsp;</span><span style=\"color: inherit; font-weight: var(--bs-body-font-weight); text-align: var(--bs-body-text-align);\">{{service_name}}</span><span style=\"text-align: var(--bs-body-text-align);\">. Below are the details of your appointment:</span></p><p><b>Booking Details:</b><br></p><ol><li><b>&nbsp; &nbsp; &nbsp; Service:</b>&nbsp;<span style=\"font-size: 15px;\">{{service_name}}</span><br></li><li><b>&nbsp; &nbsp; &nbsp; Date:</b>&nbsp;<span style=\"font-size: 15px;\">{{appointment_date}}</span><br></li><li><b>&nbsp; &nbsp; &nbsp; Time:</b>&nbsp;<span style=\"font-size: 15px;\">{{appointment_time}}</span><br></li><li><b>&nbsp; &nbsp; &nbsp; Location:</b>&nbsp;<span style=\"font-size: 15px;\">{{service_address}}</span><br></li><li><b>&nbsp; &nbsp; &nbsp; Booking Reference:</b>&nbsp;<span style=\"font-size: 15px;\">{{booking_id}}</span><br></li></ol><br>Best regards,<br><span style=\"font-size: 15px;\">{{team_name}}</span><br><span style=\"font-size: 15px;\">{{contact}}</span><br><span style=\"font-size: 15px;\">{{website_link}}</span><p></p>', 1, 13, '2024-12-10 09:09:49', 13, '2025-07-21 11:23:11', NULL),
(73, 'Booking Success Email to Provider', 1, 50, NULL, 'You’ve Received a New Booking – {{service_name}} (Ref: {{booking_id}})', '<div><span style=\"font-size: 14px;\">Dear {{provider_name}},</span></div><div><span style=\"font-size: 14px;\"><br></span></div><div><span style=\"font-size: 14px;\">You’ve received a new booking for your service on <b>{{company_name}}</b>. Please find the details below:</span></div><div><span style=\"font-size: 14px;\"><br></span></div><div><span style=\"font-size: 14px;\"><b>Booking Details:</b></span></div><div><span style=\"font-size: 14px;\"><br></span></div><div><span style=\"font-size: 14px;\">&nbsp; &nbsp; Service: {{service_name}}</span></div><div><span style=\"font-size: 14px;\">&nbsp; &nbsp; Date: {{appointment_date}}</span></div><div><span style=\"font-size: 14px;\">&nbsp; &nbsp; Time: {{appointment_time}}</span></div><div><span style=\"font-size: 14px;\">&nbsp; &nbsp; Customer Name: {{user_name}}</span></div><div><span style=\"font-size: 14px;\">&nbsp; &nbsp; Location: {{service_address}}</span></div><div><span style=\"font-size: 14px;\">&nbsp; &nbsp; Booking Reference: {{booking_id}}</span></div><div><span style=\"font-size: 14px;\"><br></span></div><div><span style=\"font-size: 14px;\">Kindly ensure you\'re available and prepared for the appointment. If you have any questions, feel free to reach out.</span></div><div><span style=\"font-size: 14px;\"><br></span></div><div><span style=\"font-size: 14px;\">Best regards,&nbsp;&nbsp;</span></div><div><span style=\"font-size: 14px;\">{{team_name}}&nbsp;&nbsp;</span></div><div><span style=\"font-size: 14px;\">{{contact}}&nbsp;&nbsp;</span></div><div><span style=\"font-size: 14px;\">{{website_link}}</span></div><div><br></div>', 1, 4, '2024-12-10 09:09:49', 4, '2025-07-21 11:23:11', NULL),
