(76, 'Booking Accept email to Admin', 1, 38, NULL, 'Booking Accepted by Provider – Booking ID: {{booking_id}}', '<div>Dear {{admin_name}},</div>\n\n<div><br></div>\n\n<div>We would like to inform you that a service booking has been <strong>accepted</strong> by the provider. Please find the details below:</div>\n\n<div><br></div>\n\n<div>&nbsp; &nbsp; <strong>Booking ID:</strong> {{booking_id}}</div>\n<div>&nbsp; &nbsp; <strong>Service Name:</strong> {{service_name}}</div>\n<div>&nbsp; &nbsp; <strong>Scheduled Date &amp; Time:</strong> {{appointment_date}} at {{appointment_time}}</div>\n<div>&nbsp; &nbsp; <strong>Customer Name:</strong> {{customer_name}}</div>\n<div>&nbsp; &nbsp; <strong>Provider Name:</strong> {{provider_name}}</div><div style=\"\"><span style=\"font-weight: 700;\">&nbsp; &nbsp;&nbsp;</span><span style=\"color: inherit; font-weight: 700;\">Staff Name:</span><span style=\"color: inherit;\">&nbsp;{{staff_name}}</span></div>\n\n<div><br></div>\n\n<div>No further action is required unless follow-up is needed. You may review this booking from the admin panel.</div>\n\n<div><br></div>\n\n<div><strong>Support Contact:</strong> {{contact}}</div>\n\n<div><br></div>\n\n<div>Thank you.</div>\n\n<div><br></div>\n\n<div>Best regards,</div>\n<div>{{company_name}} System</div>', 1, 4, '2024-12-27 08:34:28', 4, '2025-08-12 22:27:01', NULL),
(77, 'Provider Staff Reset Password Email', 1, 52, NULL, 'You\'ve been added as staff  - Set your password to get started', '<p></p><p data-start=\"319\" data-end=\"341\"><strong data-start=\"319\" data-end=\"341\">Hi </strong><b>{{first_name}}&nbsp;{{last_name}}</b><strong data-start=\"319\" data-end=\"341\">,</strong></p>\n<p data-start=\"343\" data-end=\"424\">You\'ve been added as a staff member to <strong data-start=\"382\" data-end=\"403\">{{provider_name}}</strong> on <strong data-start=\"407\" data-end=\"423\">{{company_name}}</strong>.</p>\n<p data-start=\"426\" data-end=\"553\">To get started, you’ll need to set your password. Please click the button below to reset your password and access your account.</p><b>\n\nReset Password Link:</b>&nbsp;<a href=\"{{link}}\" target=\"_blank\">{{link}}</a><p></p><p>\n\n</p><p data-start=\"596\" data-end=\"671\">If you weren\'t expecting this invitation, you can safely ignore this email.</p>\n<p data-start=\"673\" data-end=\"704\">Thanks,<br data-start=\"680\" data-end=\"683\">\n<strong data-start=\"683\" data-end=\"704\"><span data-start=\"407\" data-end=\"423\">{{company_name}}</span> Team</strong></p><p></p>', 1, 1, '2024-12-10 09:09:49', 1, '2024-12-10 09:09:49', NULL),
